import React from 'react';
import ReactDOM from 'react-dom';
//import './index.css'; import App from './App';
import * as serviceWorker from './serviceWorker';
import { Header } from "./components/header/header";
import { Panel } from "./components/panel/panel";
import { Listview } from "./components/listview/listview";
import { Card } from "./components/card/card";
import { Carrousel } from "./components/carrousel/carrousel";

ReactDOM.render(
    //<App/>,
    <div>
        <Card>
            <Header label="My Header 1" />
        </Card>
        <Panel
            header={<div>This is the header</div>}
            footer={
                <div>
                    <button>Cancel</button>
                    <button>Save</button>
                </div>
            }
        >
            <Listview items={["Titanic", "Avatar", "Alien", "Gladiator", "Star Wars"]} />
        </Panel>
        <Card>
            <Listview items={["Titanic", "Avatar", "Alien", "Gladiator", "Star Wars"]} />
        </Card>
        <Carrousel
            items={[
                <img style={{ width: "250px", height: "250px" }} src="http://origin-www.readersdigest.ca/wp-content/uploads/sites/14/2011/01/4-ways-cheer-up-depressed-cat.jpg" />,
                <img style={{ width: "250px", height: "250px" }} src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRURONVmXA7_0BOr2wOtLjbPpqTICpAurAQAck_MHMInmfUMdq38A" />,
                <img style={{ width: "250px", height: "250px" }} src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTXjhYG2c5myi8y_vziQOoCg_4WvcIHkAFKr9PpsJCUZSTKZtDD" />,
                <img style={{ width: "250px", height: "250px" }} src="https://cdn.pixabay.com/photo/2018/04/20/17/18/cat-3336579_1280.jpg" />
            ]}
        />
    </div>,
    document.getElementById('root')
);

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: http://bit.ly/CRA-PWA
serviceWorker.unregister();
